import React from 'react'
import { Container,Row,Col } from "react-bootstrap";

function APIDetail() {
  return (
    <Container fluid>
        <Row style={{backgroundColor: "#DABBFF"}}>
        <Col>
          <h1>APIs Demo</h1>
        </Col>
      </Row>
    </Container>
  )
}

export default APIDetail
